import React from "react";
import { useState,useEffect } from "react";
import { useLocation } from "react-router-dom";
import service from "../service";
import "./addCoupon.css";
const AddCoupon = () =>
{
    const getuserid = useLocation()//checks for any received value from any component(here board-company-component)
    const [company_id,setCompany_id] = useState(0); 
    const [location,setlocation] = useState("");
    const [company_email,setCompany_email] = useState("");
    const [company_name,setCompany_name] = useState("");
    const company_pswd = localStorage.getItem('password');
    const [product_category,setProduct_category] = useState("");
    const [coupon_Id,setCoupon_Id] = useState(0);
    const [coupon_discount,setCoupon_discount] = useState("");
    const [coupon_code,setCoupon_code] = useState("");
    const [product_id,setProduct_id] = useState(0);
    const [coupon_product_name,setCoupon_product_name] = useState("");
    const[product_price,setProduct_price] = useState(0);
    const[coupon_set_name,setCoupon_set_name] = useState("");
    console.log(getuserid.state);
    const coupon = {coupon_Id,coupon_discount,coupon_code,product_id,coupon_product_name,product_price,coupon_set_name}
    const company = {company_id,company_name,location,company_email,company_pswd,product_category,coupon}
    
    const addcouponfront = () =>
    {
        console.log(company);
        service.addnewcoupon(company).then((response) =>{
            console.log(response.data);
        }).catch(console.error);
    }

    useEffect(() => {
        if(getuserid.state)//cotains the id sent from board-company component
        {
            service.getcouponbycompId(getuserid.state).then((responsed)=>{
                setlocation(responsed.data.location)
                setCompany_email
                setCompany_name
                setProduct_category
                setCoupon_Id
                setCoupon_discount
            }
               
            )
        }
      }, []);

       return (
        <div className="addingform" >
            <form className="formdesign"  style={{marginLeft: "420px",backgroundColor: "aquamarine"}}>
            <label>
                    company_id: 
                </label>
                <input type="number" required onChange={e=>setCompany_id(e.target.value)}></input>
                <label>
                    CompanyName:
                </label>
                <input type="text" required onChange={e=>setCompany_name(e.target.value)}></input>
                <label>
                    location:
                </label>
                <input type="text" required onChange={e=>setlocation(e.target.value)}></input>
                <label>
                    company_email
                </label>
                <input type="text" required onChange={e=>setCompany_email(e.target.value)}></input>
                <label>
                    product_category
                </label>
                <input type="text" required onChange={e=>setProduct_category(e.target.value)}></input>
                <label>
                    coupon_Id
                </label>
                <input type="number" required onChange={e=>setCoupon_Id(e.target.value)}></input>
                <label>
                    coupon_discount
                </label>
                <input type="text" required onChange={e=>setCoupon_discount(e.target.value)}></input>
                <label>
                    coupon_code
                </label>
                <input type="text" required onChange={e=>setCoupon_code(e.target.value)}></input>
                <label>
                    Product_ID
                </label>
                <input type="number" required onChange={e=>setProduct_id(e.target.value)}></input>
                <label>
                    Product_Name
                </label>
                <input type="text" required onChange={e=> setCoupon_product_name(e.target.value)}></input>
                <label>
                    Product_price
                </label>
                <input type="number" required onChange={e=> setProduct_price(e.target.value)}></input>
                <label>
                    coupon_set_name
                </label>
                <input type="text" required onChange={e=> setCoupon_set_name(e.target.value)}></input>
                <br></br>
                <br></br>
           <button onClick={addcouponfront} type="button">Add Coupon </button>
           </form>
           
           <br></br>
           <br></br>
           
        </div>
       )
} 
export default AddCoupon;
